<style>
@import url('https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700;800;900&display=swap');
:root{--bg0:#070b10;--bg1:#0d1117;--bg2:#141b24;--bg3:#1a2332;--acc:#00d4a0;--acc2:#00a67d;--accB:#00ffaa;--grn:#22c55e;--ylw:#eab308;--red:#ef4444;--t1:#e8eaed;--t2:#8b95a5;--t3:#5c6878;--brd:#1e2a36;--brdA:rgba(0,212,160,0.3)}
*{margin:0;padding:0;box-sizing:border-box}
body{font-family:'Inter',system-ui,sans-serif;background:var(--bg0);color:var(--t1);min-height:100vh}
::-webkit-scrollbar{width:5px;height:5px}::-webkit-scrollbar-track{background:var(--bg1)}::-webkit-scrollbar-thumb{background:var(--acc2);border-radius:3px}
.hdr{background:linear-gradient(135deg,var(--bg1),#0a1520);border-bottom:1px solid var(--brd);padding:14px 20px;position:sticky;top:0;z-index:100}
.hdr-in{max-width:1400px;margin:0 auto;display:flex;align-items:center;justify-content:space-between;gap:14px;flex-wrap:wrap}
.logo-t{font-size:28px;font-weight:900;letter-spacing:2px;background:linear-gradient(135deg,#00ffaa,#00d4a0,#0088ff);-webkit-background-clip:text;-webkit-text-fill-color:transparent}
.logo-s{font-size:10px;color:var(--t3);letter-spacing:1px;text-transform:uppercase}
.gsel{display:flex;gap:4px;flex-wrap:wrap;justify-content:center}
.gbtn{background:var(--bg2);border:1px solid var(--brd);color:var(--t2);padding:5px 10px;border-radius:7px;cursor:pointer;font-size:10px;font-weight:500;transition:all .2s;font-family:inherit;white-space:nowrap}
.gbtn:hover{border-color:var(--acc2);color:var(--t1)}.gbtn.on{background:linear-gradient(135deg,rgba(0,212,160,.15),rgba(0,136,255,.1));border-color:var(--acc);color:var(--accB);box-shadow:0 0 10px rgba(0,212,160,.2)}
.ctr{max-width:1400px;margin:0 auto;padding:18px 20px}
.sec{margin-bottom:24px}
.stit{font-size:12px;font-weight:700;color:var(--acc);letter-spacing:2px;text-transform:uppercase;margin-bottom:10px;display:flex;align-items:center;gap:8px;cursor:pointer}
.stit::before{content:'';display:inline-block;width:3px;height:14px;background:var(--acc);border-radius:2px}
.arr{font-size:8px;margin-left:auto;color:var(--t3);transition:transform .2s}.arr.open{transform:rotate(180deg)}
.tg{display:flex;gap:3px;background:var(--bg1);border:1px solid var(--brd);border-radius:7px;padding:2px}
.tb{background:transparent;border:none;color:var(--t3);padding:4px 10px;border-radius:5px;cursor:pointer;font-size:10px;font-weight:500;transition:all .2s;font-family:inherit;white-space:nowrap}
.tb:hover{color:var(--t2)}.tb.on{background:var(--acc);color:#000;font-weight:700}
.cr{display:flex;align-items:center;gap:12px;margin-bottom:12px;flex-wrap:wrap}
.cl{font-size:10px;color:var(--t3);font-weight:600;text-transform:uppercase;letter-spacing:1px}
.fc{background:var(--bg2);border:1px solid var(--brd);border-radius:14px;padding:18px;position:relative}
.fh{display:flex;justify-content:space-between;align-items:center;margin-bottom:10px}
.ftl{font-size:13px;font-weight:700;color:var(--acc)}.ftl span{font-size:10px;font-weight:400;color:var(--t3);display:block}
.fz{cursor:pointer;transition:all .3s}.fz:hover{filter:brightness(1.3)}.fz.sel{stroke-width:2}
.zd{background:var(--bg1);border:1px solid var(--brdA);border-radius:10px;padding:14px;margin-top:10px}
.zdt{font-size:12px;font-weight:700;margin-bottom:6px}
.zdr{display:flex;justify-content:space-between;align-items:center;padding:3px 0;font-size:11px;border-bottom:1px solid rgba(30,42,54,.4)}
.zdr:last-child{border-bottom:none}.zpn{color:var(--t1);font-weight:500}.zpc{font-weight:700}
.zdg{display:grid;grid-template-columns:1fr 1fr;gap:16px}
.swb{background:var(--bg2);border:1px solid var(--brd);color:var(--t2);padding:5px 12px;border-radius:7px;cursor:pointer;font-size:10px;font-weight:600;transition:all .2s;font-family:inherit;display:flex;align-items:center;gap:5px}
.swb:hover{border-color:var(--acc);color:var(--acc)}.swb.on{background:rgba(0,212,160,.1);border-color:var(--acc);color:var(--acc)}
.mc{display:flex;flex-direction:column;gap:2px}
.mh{display:grid;grid-template-columns:1fr 56px 1fr;gap:6px;padding:8px 14px;background:var(--bg1);border:1px solid var(--brd);border-radius:9px;margin-bottom:6px}
.mht{font-size:13px;font-weight:800;color:var(--acc);letter-spacing:1px}.mht.r{text-align:right}
.mhv{font-size:10px;color:var(--t3);text-align:center;align-self:center}
.mr{display:grid;grid-template-columns:1fr 56px 1fr;gap:6px;margin-bottom:2px}
.pc{border:1px solid var(--brd);border-radius:9px;padding:9px 12px;cursor:pointer;transition:all .2s;position:relative;background:var(--bg2)}
.pc:hover{border-color:var(--acc2);background:var(--bg3)}
.pc.exp{border-color:var(--acc);background:var(--bg3)}
.pc.rt{text-align:right}
.pc.sr-grn{background:rgba(34,197,94,.08);border-color:rgba(34,197,94,.3)}
.pc.sr-ylw{background:rgba(234,179,8,.06);border-color:rgba(234,179,8,.25)}
.pc.sr-red{background:rgba(239,68,68,.06);border-color:rgba(239,68,68,.25)}
.pi{display:flex;align-items:center;gap:7px}.pc.rt .pi{flex-direction:row-reverse}
.pn{min-width:22px;height:22px;border-radius:5px;display:flex;align-items:center;justify-content:center;font-size:10px;font-weight:800;flex-shrink:0;color:#fff;padding:0 4px}
.pname{font-size:12px;font-weight:600;color:var(--t1);line-height:1.2}
.ppos{font-size:9px;color:var(--t3);font-weight:500}
.psr{margin-left:auto;text-align:right;flex-shrink:0}.pc.rt .psr{margin-left:0;margin-right:auto;text-align:left}
.psr-val{font-size:12px;font-weight:700}.psr-lbl{font-size:8px;color:#fff;font-weight:400;opacity:.7}
.mp{display:flex;align-items:center;justify-content:center}
.mpb{background:var(--acc);color:#000;border-radius:5px;padding:2px 7px;font-size:9px;font-weight:700;letter-spacing:.3px;text-align:center;line-height:1.3}
.pd{grid-column:1/-1;background:var(--bg1);border:1px solid var(--brdA);border-radius:10px;padding:14px;margin:3px 0;animation:sd .2s ease}
@keyframes sd{from{opacity:0;transform:translateY(-6px)}to{opacity:1;transform:translateY(0)}}
.ds{margin-bottom:12px}.ds:last-child{margin-bottom:0}
.dl{font-size:10px;font-weight:700;color:var(--acc);letter-spacing:1px;text-transform:uppercase;margin-bottom:5px}
.nrl{font-size:11px;color:var(--t2);padding:2px 0}.nrc{color:var(--acc2);font-weight:600}
.glt-wrap{max-height:158px;overflow-y:auto;overflow-x:auto}
.glt{width:100%;border-collapse:collapse;font-size:10px}
.glt th{text-align:left;padding:4px 6px;color:var(--t3);font-weight:600;font-size:9px;text-transform:uppercase;letter-spacing:.5px;border-bottom:1px solid var(--brd);position:sticky;top:0;background:var(--bg1);z-index:1}
.glt td{padding:4px 6px;color:var(--t2);border-bottom:1px solid rgba(30,42,54,.3)}
.glt tr:hover td{background:rgba(0,212,160,.02)}
.th{background:rgba(34,197,94,.15);color:var(--grn);font-weight:700;border-radius:3px;padding:1px 5px}
.tk{color:var(--grn);font-weight:700;font-size:11px}
.bs{grid-column:1/-1;display:flex;align-items:center;gap:10px;padding:6px 0}
.bs::before,.bs::after{content:'';flex:1;height:1px;background:var(--brd)}
.bs span{font-size:9px;color:var(--t3);font-weight:700;letter-spacing:2px;text-transform:uppercase}
.nd{font-size:10px;color:var(--t3);font-style:italic;padding:3px 0}
.gml{display:flex;align-items:center;justify-content:center;gap:10px;padding:10px 0 4px}
.gmt{font-size:15px;font-weight:800;color:var(--t1)}.gmv{font-size:11px;color:var(--t3);font-weight:600}
.gvn{text-align:center;font-size:10px;color:var(--t3);margin-bottom:14px}
.ftr{text-align:center;padding:20px;font-size:10px;color:var(--t3);border-top:1px solid var(--brd);margin-top:32px}
.opr{font-size:10px;color:var(--acc2);padding:3px 0;border-top:1px solid var(--brd);margin-top:3px}
.srow{display:flex;flex-wrap:wrap;gap:10px;margin-top:8px;padding:8px 6px;border-top:1px solid var(--brd);font-size:10px;color:var(--t2)}
.srow b{font-weight:700}
.ts-grid{display:flex;flex-direction:column;gap:4px}
.ts-row{display:grid;grid-template-columns:1fr auto 1fr;gap:8px;align-items:center;padding:5px 10px;border-radius:8px;border:1px solid rgba(30,42,54,.4);transition:background .2s}
.ts-val{font-size:14px;font-weight:700;min-width:50px}
.ts-val.l{text-align:right;display:flex;align-items:center;justify-content:flex-end;gap:8px}
.ts-val.r{text-align:left;display:flex;align-items:center;gap:8px}
.ts-lbl{font-size:10px;color:var(--t3);text-transform:uppercase;letter-spacing:.5px;font-weight:600;text-align:center;min-width:120px;white-space:nowrap}
.ts-bar{height:6px;border-radius:3px;transition:width .4s ease}
.ts-bar-wrap{flex:1;height:6px;border-radius:3px;background:rgba(255,255,255,.05);overflow:hidden;min-width:40px}
.ts-bar-wrap.l{display:flex;justify-content:flex-end}
.ts-hdr{display:grid;grid-template-columns:1fr auto 1fr;gap:8px;padding:4px 10px;margin-bottom:4px}
.ts-tn{font-size:12px;font-weight:800;letter-spacing:1px;text-transform:uppercase}
.ts-tn.l{text-align:right}.ts-tn.r{text-align:left}.ts-tn.c{text-align:center;color:var(--t3);font-weight:400;font-size:10px}
.gl-split{display:grid;grid-template-columns:1fr 1fr;gap:12px;margin-top:8px}
.gl-col-hdr{font-size:11px;font-weight:700;letter-spacing:.5px;margin-bottom:6px;text-transform:uppercase}
.gl-wrap{max-height:220px;overflow-y:auto}
.gl-tbl{width:100%;border-collapse:collapse;font-size:11px}
.gl-tbl th{color:var(--t3);font-size:9px;text-transform:uppercase;letter-spacing:.5px;padding:4px 6px;text-align:left;border-bottom:1px solid var(--brd);font-weight:600;position:sticky;top:0;background:var(--bg1)}
.gl-tbl td{padding:4px 6px;border-bottom:1px solid rgba(30,42,54,.4);color:var(--t2)}
.gl-tbl tr:hover td{background:rgba(0,212,160,.03)}
.gl-w{color:var(--grn);font-weight:700}.gl-l{color:var(--red);font-weight:700}
.gl-score{font-weight:600;color:var(--t1)}
.form-row{display:flex;align-items:center;justify-content:center;gap:24px;margin-bottom:8px}
.form-dots{display:flex;gap:4px;align-items:center}
.form-dot{width:20px;height:20px;border-radius:50%;display:flex;align-items:center;justify-content:center;font-size:9px;font-weight:800;color:#fff}
.form-lbl{font-size:9px;color:var(--t3);text-transform:uppercase;letter-spacing:.5px;margin-right:4px;font-weight:600}
@media(max-width:768px){.mr,.mh{grid-template-columns:1fr 36px 1fr;gap:3px}.pc{padding:7px 8px}.pname{font-size:10px}.zdg{grid-template-columns:1fr}.gsel{gap:3px}.gbtn{padding:3px 6px;font-size:9px}.hdr-in{flex-direction:column}.gl-split{grid-template-columns:1fr}}
</style>
</head>

  RABBITOHS:"Rabbitohs",ROOSTERS:"Roosters",TIGERS:"Tigers",
  PANTHERS:"Panthers",RAIDERS:"Raiders"
};

function ord(n){
  const s=['th','st','nd','rd'];
  const v=n%100;
  return n+(s[(v-20)%10]||s[v]||s[0]);
}

function normPos(pos){
  if(!pos)return pos;
  const lp=pos.trim().toLowerCase();
  if(lp.includes('left second row')||lp.includes('left 2nd row'))return 'Left 2nd row';
  if(lp.includes('right second row')||lp.includes('right 2nd row'))return 'Right 2nd row';
  if(lp==='bench'||lp==='interchange'||lp==='18th man')return 'Bench';
  if(lp==='2nd row')return '2nd Row';
  if(lp==='injured')return 'Injured';
  const p=pos.trim();
  return p[0].toUpperCase()+p.slice(1);
}

function matchTT(rec, tt) {
  if (tt==="all") return true;
  if (tt==="first") return rec.tt==="First";
  if (tt==="first3") return rec.tt==="First"||rec.tt==="Second"||rec.tt==="Third";
  if (tt==="last") return rec.tt==="Last";
  if (tt==="h1") return rec.h==="1st";
  if (tt==="h2") return rec.h==="2nd";
  return true;
}

const MO = [
  {pA:"Fullback",pB:"Fullback",l:"FB"},
  {pA:"Left Wing",pB:"Right Wing",l:"LW / RW"},
  {pA:"Left Centre",pB:"Right Centre",l:"LC / RC"},
  {pA:"Right Centre",pB:"Left Centre",l:"RC / LC"},
  {pA:"Right Wing",pB:"Left Wing",l:"RW / LW"},
  {pA:"Left Half",pB:"Right Half",l:"FE / HB"},
  {pA:"Right Half",pB:"Left Half",l:"HB / FE"},
  {pA:"Prop",pB:"Prop",l:"PR",multi:true},
  {pA:"Hooker",pB:"Hooker",l:"HK"},
  {pA:"Left 2nd row",pB:"Right 2nd row",l:"LSR / R2R"},
  {pA:"Right 2nd row",pB:"Left 2nd row",l:"R2R / LSR"},
  {pA:"Lock",pB:"Lock",l:"LK"},
];

function fp(list,pos,idx=0){
  if(!list)return null;
  const m=list.filter(p=>p.position.toLowerCase().replace(/\s+/g,'')===(pos||'').toLowerCase().replace(/\s+/g,''));
  return m[idx]||null;
}
function fb(list){
  return list?list.filter(p=>p.position==="Interchange"||p.position==="18th Man"||p.position==="Reserve"):[];
}

// ===== FIELD COMPONENT =====
function Field({tA,tB,period,tryType,swapped}){
  const [selZ,setSelZ]=useState(null);

  const recs=useMemo(()=>{
    let r=D.tryRecords;
    if(period==="last10") r=r.filter(x=>x.r>=Math.max(1,D.maxRound-9));
    if(period==="last5") r=r.filter(x=>x.r>=Math.max(1,D.maxRound-4));
    return r.filter(x=>matchTT(x,tryType));
  },[period,tryType]);

  const aKey=swapped?tB:tA, bKey=swapped?tA:tB;

  const aRecs=useMemo(()=>recs.filter(x=>x.tm===aKey),[recs,aKey]);
  const bRecs=useMemo(()=>recs.filter(x=>x.op===bKey),[recs,bKey]);

  function zoneStats(records,mode){
    const counts={};const players={};
    ZONES.forEach(z=>{counts[z]=0;players[z]={}});
    records.forEach(r=>{
      const rawZ=r.l;
      const z=mode==="def"?(ZONE_MIRROR[rawZ]||rawZ):rawZ;
      if(!counts.hasOwnProperty(z))return;
      counts[z]++;
      const name=mode==="def"?r.p:r.s;
      players[z][name]=(players[z][name]||0)+1;
    });
    const tot=Object.values(counts).reduce((a,b)=>a+b,0);
    const pcts={};ZONES.forEach(z=>pcts[z]=tot?Math.round(counts[z]/tot*1000)/10:0);
    const sorted={};ZONES.forEach(z=>sorted[z]=Object.entries(players[z]).sort((a,b)=>b[1]-a[1]));
    return {pcts,players:sorted,total:tot};
  }

  const aStats=useMemo(()=>zoneStats(aRecs,"atk"),[aRecs]);
  const bStats=useMemo(()=>zoneStats(bRecs,"def"),[bRecs]);

  const W=860,rH=155,gap=10,H=rH*2+gap+6;
  const zW=(W-6)/5;

  function clickZone(zone){setSelZ(selZ===zone?null:zone)}

  return (
    <div className="fc">
      <div style={{textAlign:'center',marginBottom:8}}>
        <span style={{color:'#ef4444',fontSize:13,fontWeight:800,letterSpacing:1}}>{D.teamAbbrev[bKey]} DEFENCE</span>
        <span style={{color:'var(--t3)',fontSize:11,fontWeight:400,marginLeft:6}}>({bStats.total} tries conceded)</span>
      </div>
      <div style={{position:'relative',width:'100%',maxWidth:900,margin:'0 auto'}}>
        <svg viewBox={`0 0 ${W} ${H}`} style={{width:'100%',height:'auto'}}>
          <rect x="0" y="0" width={W} height={H} rx="10" fill="#0d2810"/>
          <line x1="3" y1={rH+gap/2+3} x2={W-3} y2={rH+gap/2+3} stroke="rgba(255,255,255,.15)" strokeWidth="2" strokeDasharray="6,3"/>
          <rect x="1" y="1" width={W-2} height={H-2} rx="10" fill="none" stroke="rgba(255,255,255,.08)" strokeWidth="1"/>

          {/* Top row: Defence zones mirrored */}
          {ZONES_REV.map((z,i)=>{
            const x=i*zW+3,w=zW-2,pct=bStats.pcts[z]||0;
            const op=.08+(pct/100)*.4;
            const isSel=selZ===ZONE_MIRROR[z];
            return (
              <g key={`b${i}`} className={`fz${isSel?' sel':''}`} onClick={()=>clickZone(ZONE_MIRROR[z])}>
                <rect x={x} y={3} width={w} height={rH} rx="7"
                  fill={`rgba(239,68,68,${op})`}
                  stroke={isSel?"#ff6666":"rgba(255,255,255,.06)"}
                  strokeWidth={isSel?2:.5}/>
                {z.split(' ').map((word,wi)=>(
                  <text key={wi} x={x+w/2} y={rH/2-22+wi*14+3} textAnchor="middle"
                    fill="rgba(255,255,255,.5)" fontSize="14" fontWeight="700" letterSpacing="1">
                    {word.toUpperCase()}
                  </text>
                ))}
                <text x={x+w/2} y={rH/2+22+3} textAnchor="middle" fill="#ff8888" fontSize="32" fontWeight="900">{pct}%</text>
              </g>
            );
          })}

          {/* Bottom row: Attack zones */}
          {ZONES.map((z,i)=>{
            const x=i*zW+3,w=zW-2,pct=aStats.pcts[z]||0;
            const op=.12+(pct/100)*.5;
            const bY=rH+gap+3;
            const isSel=selZ===z;
            return (
              <g key={`a${i}`} className={`fz${isSel?' sel':''}`} onClick={()=>clickZone(z)}>
                <rect x={x} y={bY} width={w} height={rH} rx="7"
                  fill={`rgba(0,212,160,${op})`}
                  stroke={isSel?"#00ffaa":"rgba(255,255,255,.06)"}
                  strokeWidth={isSel?2:.5}/>
                {z.split(' ').map((word,wi)=>(
                  <text key={wi} x={x+w/2} y={bY+rH/2-22+wi*14} textAnchor="middle"
                    fill="rgba(255,255,255,.5)" fontSize="14" fontWeight="700" letterSpacing="1">
                    {word.toUpperCase()}
                  </text>
                ))}
                <text x={x+w/2} y={bY+rH/2+22} textAnchor="middle" fill="#00ffaa" fontSize="32" fontWeight="900">{pct}%</text>
              </g>
            );
          })}
        </svg>
      </div>
      <div style={{textAlign:'center',marginTop:8}}>
        <span style={{color:'#00ffaa',fontSize:13,fontWeight:800,letterSpacing:1}}>{D.teamAbbrev[aKey]} ATTACK</span>
        <span style={{color:'var(--t3)',fontSize:11,fontWeight:400,marginLeft:6}}>({aStats.total} tries scored)</span>
      </div>

      {selZ && (()=>{
        const mirrorZ=ZONE_MIRROR[selZ];
        const aPlayers=aStats.players[selZ]||[];
        const bPlayers=bStats.players[mirrorZ]||[];
        return (
          <div className="zd">
            <div className="zdg">
              <div>
                <div className="zdt" style={{color:D.teamColors[aKey]||'var(--acc)'}}>
                  {D.teamAbbrev[aKey]} scorers {selZ}
                </div>
                {aPlayers.length===0?<div className="nd">No tries</div>:
                  <div style={{maxHeight:95,overflowY:'auto'}}>{aPlayers.map(([n,c],i)=><div key={i} className="zdr"><span className="zpn">{n}</span><span className="zpc" style={{color:D.teamColors[aKey]||'var(--acc)'}}>{c}</span></div>)}</div>}
              </div>
              <div>
                <div className="zdt" style={{color:D.teamColors[bKey]||'var(--red)'}}>
                  {D.teamAbbrev[bKey]} conceded by position {mirrorZ}
                </div>
                {bPlayers.length===0?<div className="nd">No tries</div>:
                  <div style={{maxHeight:95,overflowY:'auto'}}>{bPlayers.map(([n,c],i)=><div key={i} className="zdr"><span className="zpn">{n}</span><span className="zpc" style={{color:D.teamColors[bKey]||'var(--red)'}}>{c}</span></div>)}</div>}
              </div>
            </div>
          </div>
        );
      })()}
    </div>
  );
}

// ===== PLAYER CARD =====
function PC({pl,side,srPeriod,srMode,teamKey,oppKey,isExp,onTog}){
  if(!pl) return <div className="pc" style={{opacity:.25}}><div className="pi"><span className="pname" style={{color:'var(--t3)'}}>TBA</span></div></div>;
  const isR=side==='right';
  const col=D.teamColors[teamKey]||'var(--acc)';

  const sr=useMemo(()=>{
    let games;
    if(srMode==='h2h'){
      const allG=D.playerGames[pl.player]||[];
      const oppName=KEY_TO_OPP[oppKey];
      const h2h=allG.filter(g=>g.oF===oppName);
      if(srPeriod==='last3years') games=h2h.filter(g=>['2023','2024','2025'].includes(g.y));
      else if(srPeriod==='lastSeason') games=h2h.filter(g=>g.y==='2025');
      else if(srPeriod==='last10') games=h2h.slice(0,10);
      else if(srPeriod==='last5') games=h2h.slice(0,5);
      else games=h2h;
    } else if(srMode==='posVsOpp'){
      const effPos=pl.primaryPos||pl.position;
      const nPos=normPos(effPos);
      const pvKey=`${oppKey}|${nPos}`;
      const pvData=D.posVsOpp[pvKey]||[];
      if(srPeriod==='last3years') games=pvData.filter(g=>['2023','2024','2025'].includes(String(g.y)));
      else if(srPeriod==='lastSeason') games=pvData.filter(g=>String(g.y)==='2025');
      else if(srPeriod==='last10') games=pvData.slice(0,10);
      else if(srPeriod==='last5') games=pvData.slice(0,5);
      else games=pvData;
    } else if(srMode==='first'||srMode==='first3'||srMode==='last'||srMode==='h1'||srMode==='h2'){
      const allG=D.playerGames[pl.player]||[];
      let base;
      if(srPeriod==='last3years') base=allG.filter(g=>['2023','2024','2025'].includes(g.y));
      else if(srPeriod==='lastSeason') base=allG.filter(g=>g.y==='2025');
      else if(srPeriod==='last10') base=allG.slice(0,10);
      else if(srPeriod==='last5') base=allG.slice(0,5);
      else base=allG;
      games=base;
      // For try-time modes, compute SR based on the specific column
      const tot=games.length;
      if(tot===0) return null;
      let scored=0;
      if(srMode==='first') scored=games.filter(g=>g.ft==='Yes').length;
      else if(srMode==='first3') scored=games.filter(g=>g.t123==='Yes').length;
      else if(srMode==='last') scored=games.filter(g=>g.lt==='Yes').length;
      else if(srMode==='h1') scored=games.filter(g=>g.h==='1st').length;
      else if(srMode==='h2') scored=games.filter(g=>g.h==='2nd').length;
      return {scored,tot,pct:Math.round(scored/tot*100)};
    } else {
      const allG=D.playerGames[pl.player]||[];
      if(srPeriod==='last3years') games=allG.filter(g=>['2023','2024','2025'].includes(g.y));
      else if(srPeriod==='lastSeason') games=allG.filter(g=>g.y==='2025');
      else if(srPeriod==='last10') games=allG.slice(0,10);
      else if(srPeriod==='last5') games=allG.slice(0,5);
      else games=allG;
    }
    const tot=games.length;
    if(tot===0) return null;
    const scored=games.filter(g=>g.t>0).length;
    return {scored,tot,pct:Math.round(scored/tot*100)};
  },[pl.player,pl.position,srPeriod,srMode,oppKey]);

  const srPct=sr?sr.pct:null;
  const srClass=srPct===null?'':(srPct>=70?'sr-grn':(srPct>=40?'sr-ylw':'sr-red'));
  const srColor=srPct===null?'var(--t3)':(srPct>=70?'var(--grn)':(srPct>=40?'var(--ylw)':'var(--red)'));

  return (
    <div className={`pc ${isR?'rt':''} ${isExp?'exp':''} ${srClass}`} onClick={onTog}>
      <div className="pi">
        <div className="pn" style={{background:col}}>{pl.number}</div>
        <div>
          <div className="pname">{pl.player}</div>
          <div className="ppos">{pl.position}{pl.primaryPos?<span style={{color:'var(--acc2)',marginLeft:4}}>({pl.primaryPos})</span>:''}</div>
        </div>
        <div className="psr">
          <div className="psr-val" style={{color:srColor}}>{sr?`${sr.pct}%`:'-'}</div>
          <div className="psr-lbl">try strike rate</div>
        </div>
      </div>
    </div>
  );
}

// ===== PLAYER DETAIL =====
function PD({pn,teamKey,oppKey,pos,primaryPos,srPeriod,srMode}){
  const nn=D.playerNonNrl[pn];
  const allGFull=(D.playerGames[pn]||[]);
  const oppName=KEY_TO_OPP[oppKey];
  const h2hGFull=allGFull.filter(g=>g.oF===oppName);

  // Game log: H2H shows opponent games, else show ALL years (2023-2025)
  const allG=srMode==='h2h' ? h2hGFull : allGFull;

  const effPos=primaryPos||pos;
  const nPos=normPos(effPos);
  const pvKey=`${oppKey}|${nPos}`;
  const pv=D.posVsOpp[pvKey]||[];

  const sumG=useMemo(()=>{
    if(srMode==='posVsOpp'){
      if(srPeriod==='last10') return pv.slice(0,10);
      if(srPeriod==='last5') return pv.slice(0,5);
      return pv;
    }
    const base=srMode==='h2h' ? h2hGFull : allGFull;
    if(srPeriod==='last3years') return base.filter(g=>['2023','2024','2025'].includes(g.y));
    if(srPeriod==='lastSeason') return base.filter(g=>g.y==='2025');
    if(srPeriod==='last10') return base.slice(0,10);
    if(srPeriod==='last5') return base.slice(0,5);
    return base;
  },[allGFull,h2hGFull,pv,srPeriod,srMode]);

  const pgSum=useMemo(()=>{
    if(sumG.length===0)return null;
    const n=sumG.length;
    const tries=sumG.reduce((s,g)=>s+g.t,0);
    const sr1st=sumG.filter(g=>g.ft==='Yes').length;
    const sr123=sumG.filter(g=>g.t123==='Yes').length;
    const srLast=sumG.filter(g=>g.lt==='Yes').length;
    return {
      games:n,tries,
      sr1st:Math.round(sr1st/n*100),sr123:Math.round(sr123/n*100),srLast:Math.round(srLast/n*100)
    };
  },[sumG]);

  const pvFiltered=useMemo(()=>{
    if(srPeriod==='last10') return pv.slice(0,10);
    if(srPeriod==='last5') return pv.slice(0,5);
    if(srPeriod==='last3years') return pv.filter(g=>['2023','2024','2025'].includes(String(g.y)));
    if(srPeriod==='lastSeason') return pv.filter(g=>String(g.y)==='2025');
    return pv;
  },[pv,srPeriod]);

  const pvSum=useMemo(()=>{
    if(pvFiltered.length===0)return null;
    const n=pvFiltered.length;
    const tries=pvFiltered.reduce((s,g)=>s+g.t,0);
    const sr1st=pvFiltered.filter(g=>g.ft==='Yes').length;
    const sr123=pvFiltered.filter(g=>g.t123==='Yes').length;
    const srLast=pvFiltered.filter(g=>g.lt==='Yes').length;
    const rankKey=`${nPos}|${oppKey}`;
    const rd=D.posRanks[rankKey];
    return {
      tries,games:n,
      sr1st:Math.round(sr1st/n*100),sr123:Math.round(sr123/n*100),srLast:Math.round(srLast/n*100),
      rank:rd?rd[0]:null,rankTot:rd?rd[2]:null,rankTries:rd?rd[1]:null
    };
  },[pvFiltered,nPos,oppKey]);

  const glTitle=srMode==='h2h'?`vs ${D.teamAbbrev[oppKey]||oppKey} Game Log`:'Game Log';

  return (
    <div className="pd">
      {nn && Object.keys(nn).length>0 && (
        <div className="ds">
          <div className="dl">2025 Development Stats</div>
          {Object.entries(nn).map(([comp,s])=>(
            <div key={comp} className="nrl">
              <span className="nrc">2025 {comp}</span> Games: {s.games}, Tries: {s.tries}
              {s.pos?` (${s.pos})`:''}
            </div>
          ))}
        </div>
      )}

      {allG.length>0 && (
        <div className="ds">
          <div className="dl">{glTitle} ({allG.length} games)</div>
          {pgSum && (
            <div className="srow" style={{marginTop:0,borderTop:'none',paddingTop:0}}>
              <span><b style={{color:'var(--t1)'}}>Games:</b> {pgSum.games}</span>
              <span><b style={{color:'var(--t1)'}}>Tries:</b> {pgSum.tries}</span>
              <span><b style={{color:'var(--grn)'}}>1st Try SR:</b> {pgSum.sr1st}%</span>
              <span><b style={{color:'var(--ylw)'}}>1/2/3 SR:</b> {pgSum.sr123}%</span>
              <span><b style={{color:'var(--acc)'}}>Last SR:</b> {pgSum.srLast}%</span>
            </div>
          )}
          <div className="glt-wrap">
            <table className="glt">
              <thead><tr>
                <th>Yr</th><th>Rd</th><th>Opp</th><th>Pos</th>
                {(()=>{
                  const allCols=['Tries','1st','1/2/3','Last','1H','2H'];
                  const swapMap={first:1,first3:2,last:3,h1:4,h2:5};
                  const si=swapMap[srMode];
                  if(si){
                    const front=[allCols[si],allCols[0]];
                    const rest=allCols.filter((_,idx)=>idx!==0&&idx!==si);
                    return [...front.map((c,ci)=><th key={'f'+ci}>{c}</th>),
                      <th key="mins">Mins</th>,<th key="lb">LB</th>,<th key="runs">Runs</th>,<th key="tb">TB</th>,
                      ...rest.map((c,ci)=><th key={'r'+ci}>{c}</th>)];
                  }
                  return [...allCols.map((c,ci)=><th key={ci}>{c}</th>),
                    <th key="mins">Mins</th>,<th key="lb">LB</th>,<th key="runs">Runs</th>,<th key="tb">TB</th>];
                })()}
              </tr></thead>
              <tbody>
                {allG.map((g,i)=>{
                  const vals=[
                    g.t>0?<span className="th">{g.t}</span>:<span style={{color:'#ef4444',fontWeight:600}}>{g.t}</span>,
                    g.ft==='Yes'?<span className="tk">&#10003;</span>:'',
                    g.t123==='Yes'?<span className="tk">&#10003;</span>:'',
                    g.lt==='Yes'?<span className="tk">&#10003;</span>:'',
                    g.h==='1st'?<span className="tk">&#10003;</span>:'',
                    g.h==='2nd'?<span className="tk">&#10003;</span>:''
                  ];
                  const swapMap={first:1,first3:2,last:3,h1:4,h2:5};
                  const si=swapMap[srMode];
                  if(si){
                    const front=[vals[si],vals[0]];
                    const rest=vals.filter((_,idx)=>idx!==0&&idx!==si);
                    return (
                      <tr key={i}>
                        <td>{g.y}</td><td>{g.r}</td><td>{g.o}</td><td>{PA[g.p]||g.p}</td>
                        {front.map((v,vi)=><td key={'f'+vi}>{v}</td>)}
                        <td>{g.m}</td><td>{g.lb}</td><td>{g.runs}</td><td>{g.tb}</td>
                        {rest.map((v,vi)=><td key={'r'+vi}>{v}</td>)}
                      </tr>
                    );
                  }
                  return (
                    <tr key={i}>
                      <td>{g.y}</td><td>{g.r}</td><td>{g.o}</td><td>{PA[g.p]||g.p}</td>
                      {vals.map((v,vi)=><td key={vi}>{v}</td>)}
                      <td>{g.m}</td><td>{g.lb}</td><td>{g.runs}</td><td>{g.tb}</td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        </div>
      )}

      {pvFiltered.length>0 && (
        <div className="ds">
          <div className="dl">{PA[nPos]||nPos} vs {D.teamAbbrev[oppKey]||oppKey} ({pvFiltered.length} games)</div>
          {pvSum && (
            <div className="srow" style={{marginTop:0,borderTop:'none',paddingTop:0}}>
              <span><b style={{color:'var(--t1)'}}>Tries:</b> {pvSum.tries}</span>
              <span><b style={{color:'var(--grn)'}}>1st Try SR:</b> {pvSum.sr1st}%</span>
              <span><b style={{color:'var(--ylw)'}}>1/2/3 SR:</b> {pvSum.sr123}%</span>
              <span><b style={{color:'var(--acc)'}}>Last SR:</b> {pvSum.srLast}%</span>
              {pvSum.rank && (
                <span><b style={{color:'var(--acc)'}}>Rank:</b> {ord(pvSum.rank)} of {pvSum.rankTot} ({pvSum.rankTries} tries conceded)</span>
              )}
            </div>
          )}
          <div className="glt-wrap">
            <table className="glt">
              <thead><tr>
                <th>Rd</th><th>Player</th><th>Team</th>
                {(()=>{
                  const allCols=['Tries','1st','1/2/3','Last','1H','2H'];
                  const swapMap={first:1,first3:2,last:3,h1:4,h2:5};
                  const si=swapMap[srMode];
                  if(si){
                    const front=[allCols[si],allCols[0]];
                    const rest=allCols.filter((_,idx)=>idx!==0&&idx!==si);
                    return [...front.map((c,ci)=><th key={'f'+ci}>{c}</th>),
                      <th key="mins">Mins</th>,<th key="lb">LB</th>,<th key="runs">Runs</th>,<th key="tb">TB</th>,
                      ...rest.map((c,ci)=><th key={'r'+ci}>{c}</th>)];
                  }
                  return [...allCols.map((c,ci)=><th key={ci}>{c}</th>),
                    <th key="mins">Mins</th>,<th key="lb">LB</th>,<th key="runs">Runs</th>,<th key="tb">TB</th>];
                })()}
              </tr></thead>
              <tbody>
                {pvFiltered.map((g,i)=>{
                  const vals=[
                    g.t>0?<span className="th">{g.t}</span>:<span style={{color:'#ef4444',fontWeight:600}}>{g.t}</span>,
                    g.ft==='Yes'?<span className="tk">&#10003;</span>:'',
                    g.t123==='Yes'?<span className="tk">&#10003;</span>:'',
                    g.lt==='Yes'?<span className="tk">&#10003;</span>:'',
                    g.h==='1st'?<span className="tk">&#10003;</span>:'',
                    g.h==='2nd'?<span className="tk">&#10003;</span>:''
                  ];
                  const swapMap={first:1,first3:2,last:3,h1:4,h2:5};
                  const si=swapMap[srMode];
                  if(si){
                    const front=[vals[si],vals[0]];
                    const rest=vals.filter((_,idx)=>idx!==0&&idx!==si);
                    return (
                      <tr key={i}>
                        <td>{g.r}</td>
                        <td style={{color:'var(--acc2)',fontWeight:500}}>{g.p}</td>
                        <td>{g.tm}</td>
                        {front.map((v,vi)=><td key={'f'+vi}>{v}</td>)}
                        <td>{g.m}</td><td>{g.lb}</td><td>{g.runs}</td><td>{g.tb}</td>
                        {rest.map((v,vi)=><td key={'r'+vi}>{v}</td>)}
                      </tr>
                    );
                  }
                  return (
                    <tr key={i}>
                      <td>{g.r}</td>
                      <td style={{color:'var(--acc2)',fontWeight:500}}>{g.p}</td>
                      <td>{g.tm}</td>
                      {vals.map((v,vi)=><td key={vi}>{v}</td>)}
                      <td>{g.m}</td><td>{g.lb}</td><td>{g.runs}</td><td>{g.tb}</td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        </div>
      )}

      {!nn && allG.length===0 && pv.length===0 && (
        <div className="nd">No detailed stats available for this player</div>
      )}
    </div>
  );
}

function TLS({tA,tB,srPeriod,srMode}){
  const [exp,setExp]=useState(null);
  const lA=D.teamLists[tA]||[], lB=D.teamLists[tB]||[];
  const tog=(k)=>setExp(exp===k?null:k);

  const matchups=[];
  for(const m of MO){
    if(m.multi){
      const pA=lA.filter(p=>p.position.toLowerCase()==='prop');
      const pB=lB.filter(p=>p.position.toLowerCase()==='prop');
      for(let i=0;i<Math.max(pA.length,pB.length);i++){
        matchups.push({a:pA[i]||null,b:pB[i]||null,l:"PR"});
      }
      continue;
    }
    matchups.push({a:fp(lA,m.pA),b:fp(lB,m.pB),l:m.l});
  }

  const bA=fb(lA), bB=fb(lB);
  const maxB=Math.max(bA.length,bB.length);

  return (
    <div className="mc">
      <div className="mh">
        <div className="mht">{D.teamAbbrev[tA]}</div>
        <div className="mhv">VS</div>
        <div className="mht r">{D.teamAbbrev[tB]}</div>
      </div>

      {matchups.map((m,i)=>{
        const kA=m.a?`A_${m.a.player}`:null, kB=m.b?`B_${m.b.player}`:null;
        const sA=exp===kA&&kA, sB=exp===kB&&kB;
        return (
          <React.Fragment key={i}>
            <div className="mr">
              <PC pl={m.a} side="left" srPeriod={srPeriod} srMode={srMode}
                  teamKey={tA} oppKey={tB} isExp={sA} onTog={()=>kA&&tog(kA)}/>
              <div className="mp"><span className="mpb">{m.l}</span></div>
              <PC pl={m.b} side="right" srPeriod={srPeriod} srMode={srMode}
                  teamKey={tB} oppKey={tA} isExp={sB} onTog={()=>kB&&tog(kB)}/>
            </div>
            {sA && m.a && <PD pn={m.a.player} teamKey={tA} oppKey={tB} pos={m.a.position} primaryPos={m.a.primaryPos} srPeriod={srPeriod} srMode={srMode}/>}
            {sB && m.b && <PD pn={m.b.player} teamKey={tB} oppKey={tA} pos={m.b.position} primaryPos={m.b.primaryPos} srPeriod={srPeriod} srMode={srMode}/>}
          </React.Fragment>
        );
      })}

      {maxB>0 && (
        <>
          <div className="bs"><span>Bench & Reserves</span></div>
          {Array.from({length:maxB}).map((_,i)=>{
            const pA=bA[i]||null,pB=bB[i]||null;
            const kA=pA?`A_${pA.player}`:null,kB=pB?`B_${pB.player}`:null;
            const sA=exp===kA&&kA,sB=exp===kB&&kB;
            return (
              <React.Fragment key={`b${i}`}>
                <div className="mr">
                  <PC pl={pA} side="left" srPeriod={srPeriod} srMode={srMode}
                      teamKey={tA} oppKey={tB} isExp={sA} onTog={()=>kA&&tog(kA)}/>
                  <div className="mp"><span className="mpb">{(pA&&pA.position==='Reserve')||(pB&&pB.position==='Reserve')?'RES':'INT'}</span></div>
                  <PC pl={pB} side="right" srPeriod={srPeriod} srMode={srMode}
                      teamKey={tB} oppKey={tA} isExp={sB} onTog={()=>kB&&tog(kB)}/>
                </div>
                {sA && pA && <PD pn={pA.player} teamKey={tA} oppKey={tB} pos={pA.position} primaryPos={pA.primaryPos} srPeriod={srPeriod} srMode={srMode}/>}
                {sB && pB && <PD pn={pB.player} teamKey={tB} oppKey={tA} pos={pB.position} primaryPos={pB.primaryPos} srPeriod={srPeriod} srMode={srMode}/>}
              </React.Fragment>
            );
          })}
        </>
      )}
    </div>
  );
}

// ===== TEAM STATS COMPONENTS =====
function computeTeamStats(team, games, gameLine, gamePtsHcap) {
  const n = games.length;
  if (n === 0) return {games:0,winPct:0,linePct:null,ptsPct:null,w13:0,w112:0,l112:0,l13:0,ppg:'0.0',pcpg:'0.0'};
  let wins=0,w13=0,w112=0,l112=0,l13=0,pf=0,pa=0,lineCov=0,ptsOver=0;
  games.forEach(g => {
    const isT1 = g.t1===team;
    const scored = isT1?g.s1:g.s2;
    const conceded = isT1?g.s2:g.s1;
    const margin = scored-conceded;
    pf+=scored; pa+=conceded;
    if(margin>0){wins++;if(margin>=13)w13++;else w112++;}
    else if(margin<0){if(Math.abs(margin)>=13)l13++;else l112++;}
    if(gameLine>0){
      const isFav=team===games._fav;
      if(isFav){if(margin>gameLine)lineCov++;}
      else{if(margin>-gameLine)lineCov++;}
    }
    if(gamePtsHcap>0){if(g.tp>gamePtsHcap)ptsOver++;}
  });
  return {
    games:n,winPct:Math.round(wins/n*100),
    linePct:gameLine>0?Math.round(lineCov/n*100):null,
    ptsPct:gamePtsHcap>0?Math.round(ptsOver/n*100):null,
    w13:Math.round(w13/n*100),w112:Math.round(w112/n*100),
    l112:Math.round(l112/n*100),l13:Math.round(l13/n*100),
    ppg:(pf/n).toFixed(1),pcpg:(pa/n).toFixed(1)
  };
}

function StatRow({label, valA, valB, suffix="", isCount=false, inverse=false}) {
  const nA=parseFloat(valA)||0, nB=parseFloat(valB)||0;
  const max=Math.max(nA,nB,0.1);
  const barMaxA=isCount?(nA/max*100):Math.min(nA,100);
  const barMaxB=isCount?(nB/max*100):Math.min(nB,100);
  const dispA=valA===null?"N/A":valA+suffix;
  const dispB=valB===null?"N/A":valB+suffix;
  let aWins=false,bWins=false;
  if(valA!==null&&valB!==null){
    if(inverse){if(nA<nB)aWins=true;else if(nB<nA)bWins=true;}
    else{if(nA>nB)aWins=true;else if(nB>nA)bWins=true;}
  }
  const txtA=aWins?'#00ffaa':'var(--t1)';
  const txtB=bWins?'#00ffaa':'var(--t1)';
  const barA=aWins?'#00ffaa':'var(--t3)';
  const barB=bWins?'#00ffaa':'var(--t3)';
  const bgA=aWins?'rgba(0,255,170,0.08)':'transparent';
  const bgB=bWins?'rgba(0,255,170,0.08)':'transparent';
  return (
    <div className="ts-row" style={{background:aWins||bWins?`linear-gradient(90deg,${bgA},var(--bg2) 40%,var(--bg2) 60%,${bgB})`:'var(--bg2)'}}>
      <div className="ts-val l">
        <span style={{color:txtA,fontWeight:aWins?800:700}}>{dispA}</span>
        <div className="ts-bar-wrap l"><div className="ts-bar" style={{width:(valA===null?0:barMaxA)+'%',background:barA,opacity:aWins?0.9:0.4}}/></div>
      </div>
      <div className="ts-lbl">{label}</div>
      <div className="ts-val r">
        <div className="ts-bar-wrap"><div className="ts-bar" style={{width:(valB===null?0:barMaxB)+'%',background:barB,opacity:bWins?0.9:0.4}}/></div>
        <span style={{color:txtB,fontWeight:bWins?800:700}}>{dispB}</span>
      </div>
    </div>
  );
}

function GLRow({g,team,line,ptsLine,fav}){
  const isT1=g.t1===team;
  const scored=isT1?g.s1:g.s2;
  const conc=isT1?g.s2:g.s1;
  const opp=isT1?g.t2:g.t1;
  const res=scored>conc?'W':scored<conc?'L':'D';
  const resColor=res==='W'?'#00ffaa':res==='L'?'#ef4444':'#eab308';
  const margin=scored-conc;
  const totalPts=scored+conc;

  // Margin color: use the fav field from results data for historical games
  let marginColor='var(--t1)';
  if(line>0){
    const gameFav=g.fav||fav;
    const isFav=team===gameFav;
    const covered=(isFav&&margin>line)||(!isFav&&margin>-line);
    marginColor=covered?'#22c55e':'#ef4444';
  }

  // Total Points color: bright green if over, bright red if not
  const ptsColor=(ptsLine>0&&totalPts>ptsLine)?'#22c55e':(ptsLine>0?'#ef4444':'var(--t1)');

  return (
    <tr>
      <td>{g.s}</td>
      <td>{D.teamAbbrev[opp]||opp.substring(0,3)}</td>
      <td style={{color:resColor,fontWeight:700}}>{res} <span className="gl-score">{scored}-{conc}</span></td>
      <td>{g.v||'-'}</td>
      <td style={{color:marginColor,fontWeight:600}}>{margin>0?'+'+margin:margin}</td>
      <td style={{color:ptsColor,fontWeight:600}}>{totalPts}</td>
    </tr>
  );
}

function getForm(team){
  const tGames=D.results.filter(r=>r.t1===team||r.t2===team);
  const last5=tGames.slice(-5);
  return last5.map(g=>{
    const isT1=g.t1===team;
    const scored=isT1?g.s1:g.s2;
    const conc=isT1?g.s2:g.s1;
    if(scored>conc)return 'W';
    if(scored<conc)return 'L';
    return 'D';
  });
}

function FormDots({team}){
  const form=useMemo(()=>getForm(team),[team]);
  const colorMap={W:'#22c55e',L:'#ef4444',D:'#eab308'};
  return (
    <div className="form-dots">
      {form.map((r,i)=>(
        <div key={i} className="form-dot" style={{background:colorMap[r]||'#555'}}>{r}</div>
      ))}
    </div>
  );
}

function TeamStats({game,rgame}){
  const [open,setOpen]=useState(true);
  const [factor,setFactor]=useState('all');
  const [period,setPeriod]=useState('2025');

  const filtered=useMemo(()=>{
    let gamesA=D.results.filter(r=>r.t1===game.teamA||r.t2===game.teamA);
    let gamesB=D.results.filter(r=>r.t1===game.teamB||r.t2===game.teamB);

    if(factor==='ha'){
      gamesA=gamesA.filter(r=>(r.t1===game.teamA&&r.ha1==='H')||(r.t2===game.teamA&&r.ha2==='H'));
      gamesB=gamesB.filter(r=>(r.t1===game.teamB&&r.ha1==='A')||(r.t2===game.teamB&&r.ha2==='A'));
    } else if(factor==='h2h'){
      const h2h=D.results.filter(r=>(r.t1===game.teamA&&r.t2===game.teamB)||(r.t1===game.teamB&&r.t2===game.teamA));
      gamesA=h2h;gamesB=h2h;
    } else if(factor==='venue'){
      if(rgame&&rgame.venue){
        const vn=rgame.venue.toUpperCase();
        gamesA=gamesA.filter(r=>r.v&&r.v.toUpperCase().includes(vn));
        gamesB=gamesB.filter(r=>r.v&&r.v.toUpperCase().includes(vn));
      }
    } else if(factor==='psc'){
      gamesA=gamesA.filter(r=>r.comp==='PSC');
      gamesB=gamesB.filter(r=>r.comp==='PSC');
    } else if(factor==='wet'){
      gamesA=gamesA.filter(r=>r.cond==='WET');
      gamesB=gamesB.filter(r=>r.cond==='WET');
    } else if(factor==='favund'){
      // teamA's games as favourite, teamB's games as underdog
      if(rgame){
        const favTeam=rgame.fav;
        if(favTeam===game.teamA){
          gamesA=gamesA.filter(r=>r.fav===game.teamA);
          gamesB=gamesB.filter(r=>r.fav!==game.teamB&&(r.t1===game.teamB||r.t2===game.teamB));
        } else {
          gamesA=gamesA.filter(r=>r.fav!==game.teamA&&(r.t1===game.teamA||r.t2===game.teamA));
          gamesB=gamesB.filter(r=>r.fav===game.teamB);
        }
      }
    }

    if(period==='last10y'){gamesA=gamesA.filter(r=>r.s>=2016);gamesB=gamesB.filter(r=>r.s>=2016);}
    else if(period==='last5y'){gamesA=gamesA.filter(r=>r.s>=2021);gamesB=gamesB.filter(r=>r.s>=2021);}
    else if(period==='2025'){gamesA=gamesA.filter(r=>r.s===2025);gamesB=gamesB.filter(r=>r.s===2025);}
    else if(period==='last10g'){
      const srt=(arr)=>[...arr].sort((a,b)=>b.s-a.s||(b.s===a.s?parseInt(b.r||0)-parseInt(a.r||0):0));
      gamesA=srt(gamesA).slice(0,10);gamesB=srt(gamesB).slice(0,10);
    }

    const fav=rgame?rgame.fav:'';
    gamesA._fav=fav;gamesB._fav=fav;
    return {a:gamesA,b:gamesB};
  },[game,factor,period,rgame]);

  const lh=rgame?rgame.lh:0;
  const ph=rgame?rgame.ph:0;
  const statsA=useMemo(()=>computeTeamStats(game.teamA,filtered.a,lh,ph),[game,filtered.a,lh,ph]);
  const statsB=useMemo(()=>computeTeamStats(game.teamB,filtered.b,lh,ph),[game,filtered.b,lh,ph]);

  const glA=useMemo(()=>{const sorted=[...filtered.a].sort((a,b)=>b.s-a.s||(b.s===a.s?parseInt(b.r||0)-parseInt(a.r||0):0));return sorted.slice(0,50);},[filtered.a]);
  const glB=useMemo(()=>{const sorted=[...filtered.b].sort((a,b)=>b.s-a.s||(b.s===a.s?parseInt(b.r||0)-parseInt(a.r||0):0));return sorted.slice(0,50);},[filtered.b]);

  const factors=[['all','All'],['ha','Home/Away'],['h2h','H2H'],['venue','Venue'],['psc','Preseason'],['wet','Wet'],['favund','Fav/Und']];
  const periods=[['last10y','Last 10 Yrs'],['last5y','Last 5 Yrs'],['2025','2025'],['last10g','Last 10']];

  return (
    <div className="sec">
      <div className="stit" onClick={()=>setOpen(!open)}>
        <span>Team Stats Comparison</span>
        <span className={"arr"+(open?" open":"")}>&#9660;</span>
      </div>
      {open && (
        <>
          <div className="cr">
            <div className="cl">Factor</div>
            <div className="tg">
              {factors.map(([v,l])=>(
                <button key={v} className={"tb"+(factor===v?" on":"")} onClick={()=>setFactor(v)}>{l}</button>
              ))}
            </div>
          </div>
          <div className="cr">
            <div className="cl">Period</div>
            <div className="tg">
              {periods.map(([v,l])=>(
                <button key={v} className={"tb"+(period===v?" on":"")} onClick={()=>setPeriod(v)}>{l}</button>
              ))}
            </div>
          </div>

          <div className="ts-hdr">
            <div className="ts-tn l">{D.teamAbbrev[game.teamA]}</div>
            <div className="ts-tn c">STAT</div>
            <div className="ts-tn r">{D.teamAbbrev[game.teamB]}</div>
          </div>

          <div className="ts-grid">
            <StatRow label="Games" valA={statsA.games} valB={statsB.games} isCount={true}/>
            <StatRow label="Win %" valA={statsA.winPct} valB={statsB.winPct} suffix="%"/>
            {lh>0&&<StatRow label={`Line Cover % (${lh})`} valA={statsA.linePct} valB={statsB.linePct} suffix="%"/>}
            {ph>0&&<StatRow label={`Points Over % (${ph})`} valA={statsA.ptsPct} valB={statsB.ptsPct} suffix="%"/>}
            <StatRow label="13+ Wins" valA={statsA.w13} valB={statsB.w13} suffix="%"/>
            <StatRow label="1-12 Wins" valA={statsA.w112} valB={statsB.w112} suffix="%"/>
            <StatRow label="1-12 Losses" valA={statsA.l112} valB={statsB.l112} suffix="%" inverse={true}/>
            <StatRow label="13+ Losses" valA={statsA.l13} valB={statsB.l13} suffix="%" inverse={true}/>
            <StatRow label="Pts Scored/Gm" valA={statsA.ppg} valB={statsB.ppg} isCount={true}/>
            <StatRow label="Pts Conceded/Gm" valA={statsA.pcpg} valB={statsB.pcpg} isCount={true} inverse={true}/>
          </div>

          <div style={{marginTop:12}}>
            <div className="stit" style={{fontSize:11,marginBottom:8}}>
              <span>Game Log</span>
            </div>
              <div className="gl-split">
                <div>
                  <div className="gl-col-hdr">{D.teamAbbrev[game.teamA]} ({filtered.a.length})</div>
                  <div className="gl-wrap">
                    <table className="gl-tbl">
                      <thead><tr><th>Year</th><th>Opp</th><th>Result</th><th>Venue</th><th>Margin</th><th>Pts</th></tr></thead>
                      <tbody>{glA.map((g,i)=><GLRow key={i} g={g} team={game.teamA} line={lh} ptsLine={ph} fav={rgame?rgame.fav:''}/>)}</tbody>
                    </table>
                  </div>
                </div>
                <div>
                  <div className="gl-col-hdr" style={{textAlign:'right'}}>{D.teamAbbrev[game.teamB]} ({filtered.b.length})</div>
                  <div className="gl-wrap">
                    <table className="gl-tbl">
                      <thead><tr><th>Year</th><th>Opp</th><th>Result</th><th>Venue</th><th>Margin</th><th>Pts</th></tr></thead>
                      <tbody>{glB.map((g,i)=><GLRow key={i} g={g} team={game.teamB} line={lh} ptsLine={ph} fav={rgame?rgame.fav:''}/>)}</tbody>
                    </table>
                  </div>
                </div>
              </div>
          </div>
        </>
      )}
    </div>
  );
}

// ===== STREAKS & TRENDS =====
function Streaks({game,rgame}){
  const [open,setOpen]=useState(true);
  const [expIdx,setExpIdx]=useState(null);

  const streaks=useMemo(()=>{
    const items=[];
    const tA=game.teamA, tB=game.teamB;
    const lh=rgame?rgame.lh:0;
    const ph=rgame?rgame.ph:0;
    const venueUp=rgame&&rgame.venue?rgame.venue.toUpperCase():'';

    // Count active streak from index 0 (most recent game first)
    function activeStreak(arr,fn){
      let count=0;
      for(let i=0;i<arr.length;i++){
        if(fn(arr[i]))count++;
        else break;
      }
      return count;
    }

    // Sort descending by year then round number (most recent first)
    function parseRd(r){const n=parseInt(r);return isNaN(n)?99:n;}
    const sortDesc=(arr)=>[...arr].sort((a,b)=>b.s-a.s||(b.s===a.s?parseRd(b.r)-parseRd(a.r):0));

    // ---- TEAM STREAKS (5+) ----
    [tA,tB].forEach(team=>{
      const teamGames=sortDesc(D.results.filter(r=>r.t1===team||r.t2===team));
      const abbr=D.teamAbbrev[team]||team;

      function teamResult(g){
        const isT1=g.t1===team;
        const scored=isT1?g.s1:g.s2;
        const conc=isT1?g.s2:g.s1;
        return {scored,conc,margin:scored-conc,tp:scored+conc,
          isWin:scored>conc,isLoss:scored<conc,
          isFav:g.fav===team};
      }

      // All games - sorted newest first
      const allR=teamGames.map(g=>({...g,...teamResult(g)}));

      // Streak checks for different contexts - all sorted newest first
      const contexts=[
        {label:'All Games',games:allR},
        {label:'H2H',games:sortDesc(D.results.filter(r=>(r.t1===tA&&r.t2===tB)||(r.t1===tB&&r.t2===tA))).map(g=>({...g,...teamResult(g)}))},
        {label:'Home',games:teamGames.filter(r=>(r.t1===team&&r.ha1==='H')||(r.t2===team&&r.ha2==='H')).map(g=>({...g,...teamResult(g)}))},
        {label:'Away',games:teamGames.filter(r=>(r.t1===team&&r.ha1==='A')||(r.t2===team&&r.ha2==='A')).map(g=>({...g,...teamResult(g)}))},
        {label:'As Favourite',games:allR.filter(g=>g.isFav)},
        {label:'As Underdog',games:allR.filter(g=>!g.isFav&&g.fav)},
      ];

      contexts.forEach(ctx=>{
        if(ctx.games.length<5)return;
        const ws=activeStreak(ctx.games,g=>g.isWin);
        if(ws>=5) items.push({type:'team',sType:'win',team:abbr,teamKey:team,streak:ws,label:ctx.label,desc:`Win streak (${ctx.label})`,games:ctx.games.slice(0,ws),color:'#22c55e'});
        const ls=activeStreak(ctx.games,g=>g.isLoss);
        if(ls>=5) items.push({type:'team',sType:'win',team:abbr,teamKey:team,streak:ls,label:ctx.label,desc:`Losing streak (${ctx.label})`,games:ctx.games.slice(0,ls),color:'#ef4444'});
        if(lh>0){
          const lcs=activeStreak(ctx.games,g=>{
            const isFav=g.fav===team;
            return (isFav&&g.margin>lh)||(!isFav&&g.margin>-lh);
          });
          if(lcs>=5) items.push({type:'team',sType:'line',team:abbr,teamKey:team,streak:lcs,label:ctx.label,desc:`Line cover streak (${ctx.label})`,games:ctx.games.slice(0,lcs),color:'#22c55e'});
          const lfs=activeStreak(ctx.games,g=>{
            const isFav=g.fav===team;
            return !((isFav&&g.margin>lh)||(!isFav&&g.margin>-lh));
          });
          if(lfs>=5) items.push({type:'team',sType:'line',team:abbr,teamKey:team,streak:lfs,label:ctx.label,desc:`Line fail streak (${ctx.label})`,games:ctx.games.slice(0,lfs),color:'#ef4444'});
        }
        if(ph>0){
          const pos=activeStreak(ctx.games,g=>g.tp>ph);
          if(pos>=5) items.push({type:'team',sType:'points',team:abbr,teamKey:team,streak:pos,label:ctx.label,desc:`Points over streak (${ctx.label})`,games:ctx.games.slice(0,pos),color:'#22c55e'});
          const pus=activeStreak(ctx.games,g=>g.tp<=ph);
          if(pus>=5) items.push({type:'team',sType:'points',team:abbr,teamKey:team,streak:pus,label:ctx.label,desc:`Points under streak (${ctx.label})`,games:ctx.games.slice(0,pus),color:'#ef4444'});
        }
      });
    });

    // ---- PLAYER TRY STREAKS (3+) ----
    const bothLists=[...(D.teamLists[tA]||[]),...(D.teamLists[tB]||[])];
    const oppMap={};
    (D.teamLists[tA]||[]).forEach(p=>oppMap[p.player]=tB);
    (D.teamLists[tB]||[]).forEach(p=>oppMap[p.player]=tA);

    bothLists.forEach(pl=>{
      const pg=D.playerGames[pl.player];
      if(!pg||pg.length<3)return;
      const pTeam=D.teamAbbrev[oppMap[pl.player]===tB?tA:tB]||'';
      const oppTeam=oppMap[pl.player];
      const oppName=KEY_TO_OPP[oppTeam];
      const abbr=pl.playerAbbrev||pl.player;

      // Different game sets
      const allGames=pg;
      const h2hGames=pg.filter(g=>g.oF===oppName);
      const venueGames=venueUp?pg.filter(g=>{
        // Check if any result at this venue matches this player's game
        return false; // venue not in player games, skip
      }):[];

      const pContexts=[
        {label:'All Games',games:allGames},
        {label:`vs ${D.teamAbbrev[oppTeam]||oppTeam}`,games:h2hGames},
      ];

      // Try scoring checks
      const tryChecks=[
        {label:'try scoring',fn:g=>g.t>0},
        {label:'first try',fn:g=>g.ft==='Yes'},
        {label:'1/2/3 try',fn:g=>g.t123==='Yes'},
        {label:'last try',fn:g=>g.lt==='Yes'},
        {label:'1st half try',fn:g=>g.h==='1st'},
        {label:'2nd half try',fn:g=>g.h==='2nd'},
      ];

      pContexts.forEach(ctx=>{
        if(ctx.games.length<3)return;
        tryChecks.forEach(chk=>{
          const s=activeStreak(ctx.games,chk.fn);
          if(s>=3){
            items.push({
              type:'player',player:abbr,team:pTeam,streak:s,
              desc:`${s}-game ${chk.label} streak (${ctx.label})`,
              pGames:ctx.games.slice(0,s),color:'#00ffaa'
            });
          }
        });
      });

      // Position vs opponent - find the attacking team's player at this position
      const effPos=pl.primaryPos||pl.position;
      const nPos=normPos(effPos);
      const pvKey=`${oppTeam}|${nPos}`;
      const pvData=D.posVsOpp[pvKey]||[];
      if(pvData.length>=3){
        const pvs=activeStreak(pvData,g=>g.t>0);
        if(pvs>=3){
          // Find the player on pl's own team at this position (the attacker)
          const plTeamKey=oppMap[pl.player]===tB?tA:tB;
          const plList=D.teamLists[plTeamKey]||[];
          const atkPlayer=plList.find(op=>{
            const opPos=normPos(op.primaryPos||op.position);
            return opPos===nPos;
          });
          const atkName=atkPlayer?(atkPlayer.playerAbbrev||atkPlayer.player):(PA[nPos]||nPos);
          items.push({
            type:'position',player:atkName,team:D.teamAbbrev[plTeamKey]||plTeamKey,streak:pvs,
            desc:`${PA[nPos]||nPos} try streak vs ${D.teamAbbrev[oppTeam]||oppTeam}`,
            pvGames:pvData.slice(0,pvs),color:'#00d4a0'
          });
        }
      }
    });

    // Sort: longest streaks first
    items.sort((a,b)=>b.streak-a.streak);
    return items;
  },[game,rgame]);

  if(streaks.length===0)return null;

  return (
    <div className="sec">
      <div className="stit" onClick={()=>setOpen(!open)}>
        <span>Streaks & Trends</span>
        <span className={"arr"+(open?" open":"")}>&#9660;</span>
      </div>
      {open && (
        <div style={{display:'flex',flexWrap:'wrap',gap:8}}>
          {streaks.map((s,i)=>{
            const isExp=expIdx===i;
            const nameLabel=s.type==='team'?s.team:s.player;
            return (
              <div key={i} onClick={()=>setExpIdx(isExp?null:i)} style={{background:'var(--bg2)',border:'1px solid '+(isExp?s.color:'var(--brd)'),borderRadius:10,padding:10,cursor:'pointer',minWidth:200,maxWidth:isExp?'100%':'340px',flex:isExp?'1 1 100%':'0 1 auto',transition:'all 0.2s'}}>
                <div style={{display:'flex',alignItems:'center',gap:6,flexWrap:'wrap'}}>
                  <span style={{fontSize:14}}>{'\u{1F525}'}{s.streak}</span>
                  <span style={{fontSize:13,fontWeight:700,color:s.color}}>{nameLabel}</span>
                </div>
                <div style={{fontSize:11,color:'var(--t2)',marginTop:3}}>{s.desc}</div>
                {isExp && s.games && (
                  <div onClick={e=>e.stopPropagation()} style={{marginTop:8,maxHeight:200,overflowY:'auto'}}>
                    <table className="gl-tbl" style={{fontSize:10}}>
                      <thead><tr>
                        <th>Yr</th><th>Rd</th><th>Opp</th><th>Result</th>
                        {s.sType==='line'&&<th>Margin</th>}
                        {s.sType==='points'&&<th>Pts</th>}
                      </tr></thead>
                      <tbody>
                        {s.games.map((g,gi)=>{
                          const tk=s.teamKey||'';
                          const isT=g.t1===tk;
                          const sc=isT?g.s1:g.s2;
                          const cc=isT?g.s2:g.s1;
                          const opp=isT?g.t2:g.t1;
                          const res=sc>cc?'W':sc<cc?'L':'D';
                          const resC=res==='W'?'#00ffaa':res==='L'?'#ef4444':'#eab308';
                          const margin=sc-cc;
                          return (
                            <tr key={gi}>
                              <td>{g.s}</td><td>{g.r}</td>
                              <td>{D.teamAbbrev[opp]||opp.substring(0,3)}</td>
                              <td style={{color:resC,fontWeight:700}}>{res} {sc}-{cc}</td>
                              {s.sType==='line'&&<td style={{fontWeight:600}}>{margin>0?'+'+margin:margin}</td>}
                              {s.sType==='points'&&<td>{sc+cc}</td>}
                            </tr>
                          );
                        })}
                      </tbody>
                    </table>
                  </div>
                )}
                {isExp && s.pGames && (
                  <div onClick={e=>e.stopPropagation()} style={{marginTop:8,maxHeight:200,overflowY:'auto'}}>
                    <table className="gl-tbl" style={{fontSize:10}}>
                      <thead><tr><th>Yr</th><th>Rd</th><th>Opp</th><th>Tries</th></tr></thead>
                      <tbody>
                        {s.pGames.map((g,gi)=>(
                          <tr key={gi}>
                            <td>{g.y}</td><td>{g.r}</td><td>{g.o}</td>
                            <td>{g.t>0?<span className="th">{g.t}</span>:<span style={{color:'#ef4444'}}>{g.t}</span>}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                )}
                {isExp && s.pvGames && (
                  <div onClick={e=>e.stopPropagation()} style={{marginTop:8,maxHeight:200,overflowY:'auto'}}>
                    <table className="gl-tbl" style={{fontSize:10}}>
                      <thead><tr><th>Yr</th><th>Rd</th><th>Player</th><th>Tries</th></tr></thead>
                      <tbody>
                        {s.pvGames.map((g,gi)=>(
                          <tr key={gi}>
                            <td>{g.y||''}</td><td>{g.r}</td>
                            <td style={{color:'var(--acc2)',fontWeight:500}}>{g.p}</td>
                            <td>{g.t>0?<span className="th">{g.t}</span>:<span style={{color:'#ef4444'}}>{g.t}</span>}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                )}
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
}

// ===== MAIN DASHBOARD =====
function App(){
  const [gIdx,setGIdx]=useState(0);
  const [fPer,setFPer]=useState('season');
  const [fTT,setFTT]=useState('all');
  const [swap,setSwap]=useState(false);
  const [srPer,setSrPer]=useState('last10');
  const [srBase,setSrBase]=useState('all');
  const [srTT,setSrTT]=useState('all');
  const [activeTab,setActiveTab]=useState('tryscorers');

  const g=D.games[gIdx];

  // Find matching round game for odds/line data
  const rgame=useMemo(()=>{
    return D.roundGames.find(rg=>rg.t1===g.teamA&&rg.t2===g.teamB)||null;
  },[g]);

  const TT_OPTS = [['all','All'],['first','First'],['first3','1/2/3'],['last','Last'],['h1','1st Half'],['h2','2nd Half']];

  const SR_BASE_MODES = [['all','All Games'],['posVsOpp','Pos vs Opp'],['h2h','H2H']];
  const SR_TT_MODES = [['all','All'],['first','First'],['first3','1/2/3'],['last','Last'],['h1','1st Half'],['h2','2nd Half']];

  // Compute effective srMode: if srTT is active, use it; otherwise use srBase
  const effectiveSrMode = srTT !== 'all' ? srTT : srBase;

  return (
    <div>
      <div className="hdr">
        <div className="hdr-in">
          <div><div className="logo-t">RSG</div><div className="logo-s">NRL Try Scorer Dashboard</div></div>
          <div className="gsel">
            {D.games.map((gm,i)=>(
              <button key={i} className={`gbtn${gIdx===i?' on':''}`}
                onClick={()=>{setGIdx(i);setSwap(false)}}>
                <div style={{fontSize:8,color:'var(--t3)',letterSpacing:1,textTransform:'uppercase'}}>{gm.day.substring(0,3)}</div>
                {D.teamAbbrev[gm.teamA]} v {D.teamAbbrev[gm.teamB]}
              </button>
            ))}
          </div>
        </div>
      </div>

      <div className="ctr">
        {/* Game Title */}
        <div className="gml">
          <span className="gmt">{TN[g.teamA]||g.teamA} {rgame && <span style={{fontWeight:400,fontSize:11,color:'var(--t3)'}}>${rgame.o1}</span>}</span>
          <span className="gmv">vs</span>
          <span className="gmt">{TN[g.teamB]||g.teamB} {rgame && <span style={{fontWeight:400,fontSize:11,color:'var(--t3)'}}>${rgame.o2}</span>}</span>
        </div>
        <div className="form-row">
          <div style={{display:'flex',alignItems:'center',gap:6}}>
            <span className="form-lbl">Form</span>
            <FormDots team={g.teamA}/>
          </div>
          <div style={{display:'flex',alignItems:'center',gap:6}}>
            <FormDots team={g.teamB}/>
            <span className="form-lbl">Form</span>
          </div>
        </div>
        <div className="gvn">
          {g.day}, {g.date} | {g.time} AEDT | {g.venue}
          {rgame && (<><br/><span style={{color:'var(--acc2)'}}>Line: {rgame.lh} | Pts: {rgame.ph} | Ref: {rgame.ref}</span></>)}
        </div>

        {/* Streaks & Trends */}
        <Streaks game={g} rgame={rgame}/>

        {/* Tab Navigation */}
        <div style={{display:'flex',justifyContent:'center',gap:6,marginBottom:16}}>
          <div className="tg">
            <button className={`tb${activeTab==='tryscorers'?' on':''}`} onClick={()=>setActiveTab('tryscorers')}>Tryscorers</button>
            <button className={`tb${activeTab==='teamstats'?' on':''}`} onClick={()=>setActiveTab('teamstats')}>Team Stats</button>
          </div>
        </div>

        {/* Tryscorers Tab */}
        {activeTab==='tryscorers' && (
          <>
            {/* Try Scoring Zones */}
            <div className="sec">
              <div className="stit">Try Scoring Zones</div>
              <div style={{display:'flex',flexDirection:'column',alignItems:'center',gap:8,marginBottom:12}}>
                <div style={{display:'flex',alignItems:'center',gap:8,flexWrap:'wrap',justifyContent:'center'}}>
                  <div className="cl">Period</div>
                  <div className="tg">
                    {[['season','Season'],['last10','Last 10'],['last5','Last 5']].map(([v,l])=>(
                      <button key={v} className={`tb${fPer===v?' on':''}`} onClick={()=>setFPer(v)}>{l}</button>
                    ))}
                  </div>
                </div>
                <div style={{display:'flex',alignItems:'center',gap:8,flexWrap:'wrap',justifyContent:'center'}}>
                  <div className="cl">Time of Try</div>
                  <div className="tg">
                    {TT_OPTS.map(([v,l])=>(
                      <button key={v} className={`tb${fTT===v?' on':''}`} onClick={()=>setFTT(v)}>{l}</button>
                    ))}
                  </div>
                </div>
                <button className={`swb${swap?' on':''}`} onClick={()=>setSwap(!swap)}>
                  &#8644; {swap?'Swapped':'Swap A/D'}
                </button>
              </div>
              <Field tA={g.teamA} tB={g.teamB} period={fPer} tryType={fTT} swapped={swap}/>
            </div>

            {/* Team List Matchups */}
            <div className="sec">
              <div className="stit">Team List Matchups</div>
              <div className="cr">
                <div className="cl">Strike Rate</div>
                <div className="tg">
                  {[['last3years','Last 3 Yrs'],['lastSeason','2025'],['last10','Last 10'],['last5','Last 5']].map(([v,l])=>(
                    <button key={v} className={`tb${srPer===v?' on':''}`} onClick={()=>setSrPer(v)}>{l}</button>
                  ))}
                </div>
              </div>
              <div className="cr">
                <div className="cl">SR Mode</div>
                <div className="tg">
                  {SR_BASE_MODES.map(([v,l])=>(
                    <button key={v} className={`tb${srBase===v?' on':''}`} onClick={()=>{setSrBase(v);setSrTT('all');}}>{l}</button>
                  ))}
                </div>
              </div>
              <div className="cr">
                <div className="cl">Time of Try</div>
                <div className="tg">
                  {SR_TT_MODES.map(([v,l])=>(
                    <button key={v} className={`tb${srTT===v?' on':''}`} onClick={()=>setSrTT(v)}>{l}</button>
                  ))}
                </div>
              </div>
              <TLS tA={g.teamA} tB={g.teamB} srPeriod={srPer} srMode={effectiveSrMode}/>
            </div>
          </>
        )}

        {/* Team Stats Tab */}
        {activeTab==='teamstats' && (
          <TeamStats game={g} rgame={rgame}/>
        )}
      </div>

      <div className="ftr">RSG NRL Try Scorer Dashboard &mdash; Preseason Week 2 2026 &mdash; For Patreon Members Only</div>
    </div>
  );
}

ReactDOM.render(<App/>,document.getElementById('root'));
</script>
</body>
</html>
